Unified parse event result for all shell parsers.

This enum standardizes the return type for all `try_parse_*` functions
across different shell parsers (Bash, PowerShell, etc.).

## Design Rationale

Previously, each parser had its own custom enums (`AliasParseResult`,
`ExportParseResult`, etc.). This made adding new shell parsers difficult
as there was no clear pattern to follow.

`ParseEvent` provides a single contract:
- `Complete(Entry)` - Found a complete single-line entry
- `Started { ... }` - Found the start of a multi-line entry
- `None` - No match, try next parser

## Usage Pattern

```rust,ignore
// In bash/parsers.rs or pwsh/parsers.rs
pub fn try_parse_alias(line: &str, line_num: usize) -> ParseEvent {
if let Some(caps) = ALIAS_RE.captures(line) {
return ParseEvent::Complete(
Entry::new(EntryType::Alias, caps[1], caps[2])
.with_line_number(line_num)
);
}

if has_unclosed_quote(line) {
return ParseEvent::Started {
entry_type: EntryType::Alias,
name: extract_name(line),
boundary: BoundaryType::QuoteCounting { quote_count: 1 },
first_line: line.to_string(),
};
}

ParseEvent::None
}
```

Trait for shell configuration parsers.

Implement this trait to add support for new shell types.

## Required Methods

- [`parse`](Parser::parse) - Parse configuration file content
- [`shell_type`](Parser::shell_type) - Return the shell type this parser handles

## Example Implementation

```rust,ignore
pub struct MyShellParser;

impl Parser for MyShellParser {
fn parse(&self, content: &str) -> ParseResult {
// Parse logic here
}

fn shell_type(&self) -> ShellType {
ShellType::MyShell
}
}
```

Extract inline comment from a line, respecting quoted strings.

The comment character (typically `#`) is only recognized outside
of single and double quotes.

# Arguments

- `line`: The line to analyze
- `comment_char`: The comment character (usually `#`)

# Returns

A tuple `(code, comment)` where:
- `code`: The part before the comment (trimmed)
- `comment`: The comment text without the `#`, or `None`

# Example

```rust,ignore
let (code, comment) = extract_comment("alias ll='ls -la' # list files", '#');
assert_eq!(code, "alias ll='ls -la'");
assert_eq!(comment, Some("list files".to_string()));

// Comment inside quotes is not extracted
let (code, comment) = extract_comment("alias x='echo # not a comment'", '#');
assert_eq!(code, "alias x='echo # not a comment'");
assert_eq!(comment, None);
```

Merge another entry into this one, extending the line range and combining content.

# Merging Rules
- Updates `end_line` to cover both entries
- Merges `value` content with newline separator (value contains complete original content)
- Type upgrade: Comment + non-empty Code -> Code
- For merged entries, `value` contains all lines (comments, blanks, code)
- `name` is updated to reflect the merged line range for Comment/Code entries

# Examples
```
// Comment + Alias merging:
// Entry 1: Comment { value: "# Set up path alias", line_number: 1 }
// Entry 2: Alias { value: "alias p='pwd'", line_number: 3 }
// Result: Alias { value: "# Set up path alias\n\nalias p='pwd'", name: "p", line_number: 1, end_line: 3 }
```

Merge multiple PATH environment variable definitions into a single one

# Logic
1. Extract all path segments from each definition
2. Remove duplicates while preserving order
3. Ensure `$PATH` self-reference appears at the end
4. Return merged value and source line numbers

# Example
```
// Input:
// export PATH="$HOME/bin:$PATH"
// export PATH="$CARGO_HOME/bin:$PATH"
// export PATH="/usr/local/go/bin:$PATH"

// Output:
// export PATH="$HOME/bin:$CARGO_HOME/bin:/usr/local/go/bin:$PATH"
```

String utility functions
Split a string into lines, preserving trailing empty lines (unlike `.lines()`).

Rust's `str::lines()` strips trailing newlines:
- `"a\n".lines()` → `["a"]` (loses the trailing newline)
- `"a\n\n".lines()` → `["a", ""]` (only 1 empty line, but original has 2 newlines)

This function preserves trailing empty lines:
- `"a\nb"` → `["a", "b"]`
- `"a\n"` → `["a"]` (single trailing newline is treated as line terminator)
- `"a\n\n"` → `["a", ""]` (preserves trailing empty line)
- `"a\n\n\n"` → `["a", "", ""]` (preserves all trailing empty lines)

# Examples

```
use wenv::utils::strings::split_lines_preserve_trailing;

assert_eq!(split_lines_preserve_trailing("a\nb"), vec!["a", "b"]);
assert_eq!(split_lines_preserve_trailing("a\n"), vec!["a"]);
assert_eq!(split_lines_preserve_trailing("a\n\n"), vec!["a", ""]);
assert_eq!(split_lines_preserve_trailing("a\n\n\n"), vec!["a", "", ""]);
assert_eq!(split_lines_preserve_trailing(""), Vec::<&str>::new());
```

Bash configuration file parser.

Implements the [`Parser`] trait for parsing `.bashrc`, `.bash_profile`,
and similar Bash configuration files.

## Example

```rust,ignore
use wenv::parser::{Parser, BashParser};

let parser = BashParser::new();
let content = std::fs::read_to_string("~/.bashrc")?;
let result = parser.parse(&content);

for entry in result.entries {
println!("{}: {}", entry.entry_type, entry.name);
}
```

